function CSV_creationItemExperiment.GetValue(index, key)
	index = tostring(index)
	key = tostring(key)
    if creationItemExperiment[index] == nil then
        ZLog.Logger("Excel 获取表:creationItemExperiment  主键:".. index .." key:".. key.."出错!")
        return nil
    end
    if creationItemExperiment[index][key] == nil then
        ZLog.Logger("Excel 获取表: creationItemExperiment  主键:".. index .." key:".. key.."出错!")
        return nil
    end

    return creationItemExperiment[index][key]
end


function CSV_creationItemExperiment.Get()
    return creationItemExperiment
end

function CSV_creationItemExperiment.GetAllKeys()
    local keys = {}
    for k in pairs(creationItemExperiment) do
        keys[#keys + 1] = k
    end
    if #keys == 0 then
        ZLog.Logger(string.format("Excel 获取表: 所有主键出错"))
        return nil
    end
    return keys
end